// fungsi tanggal realtime
void date(String valDay, byte valDate, byte valMonth, int valYear)
{
    tft.setTextColor(ILI9341_BLACK);
    tft.fillRect(0, 0, 200, 30, ILI9341_WHITE);
    tft.setTextSize(2);
    tft.setCursor(10, 10);
    tft.print(valDay + ", " + String(valDate) + "/" + String(valMonth) + "/" + String(valYear));
}

// fungsi jam realtime
void time(byte valHour, byte valMinute)
{
    tft.setTextColor(ILI9341_BLACK);
    tft.fillRect(0, 0, 200, 30, ILI9341_WHITE);
    tft.setTextSize(2);
    tft.setCursor(10, 10);
    tft.print(String(valHour) + ":" + String(valMinute) + " WIB");
}

// fungsi notif kontrol
void notifKontrol(byte valueControlDate, String valueControlMonth, int valueControlYear)
{
    tft.drawRGBBitmap(0, 0, myBitmapNotifKontrol, 320, 240);
    delay(50);

    tft.setTextColor(ILI9341_PURPLE);
    tft.setTextSize(6);
    tft.setCursor(170, 65);
    tft.print(String(valueControlDate));

    tft.setTextColor(ILI9341_PURPLE);
    tft.setTextSize(2);
    tft.setCursor(155, 115);
    tft.print(valueControlMonth + " " + String(valueControlYear));
}

void display_clear()
{
    tft.fillRect(0, 0, 320, 240, ILI9341_WHITE);
}

void display_setup()
{
    tft.begin();
    tft.setRotation(3); // Rotasi layar (0 - 3 untuk orientasi)
    tft.fillScreen(ILI9341_BLACK);
}

void display_booting()
{
    display_clear();
    // Intro Logo UNNES
    tft.drawRGBBitmap(0, 0, myBitmapUnnes, 320, 240);
    delay(2000);

    display_clear();
    // Intro Logo BABAT
    tft.drawRGBBitmap(0, 0, myBitmapBABAT, 320, 240);
    delay(2000);
}

